import React, { Component } from 'react';

export class home extends Component {
    render() {
        return (
          <div className="container">
            <div className="row">
             <div className="col-md-4">
                 <b>STUDENT ID / CONTACT NO. </b>
             </div>
            </div>
          </div>
        );
    }
}

export default home;
